const initialState = {
  count: 6,
};
function reducer(state = initialState, action) {
  if (action.type === "submit") {
    var index = "data" + state.count;
    return {
      ...state,
      count: state.count + 1,
      [index]: action.value,
    };
  }
  // if (action.type === "store") {
  //   return { ...state, data: action.data, key: action.key, active: true };
  // }
  return state;
}
export default reducer;
